import React, {useState} from 'react';
import './Header.scss';

const Header = () => {
    const [open, setOpen] = useState(false);
    const navMenu = "nav-menu";
    const navMenuOpen= "nav-menuOpen";
    return (
        <div className="header">
            <div className="nav-menu">
                <div className="btnhamb">Boton Hamburguesa</div>
                <div>
                    Lista de Usuarios
                </div>
                <div>
                    Albumes
                </div>
            </div>
            <div className="logo">
                User Profile
            </div>
            <div className="">
                <span>&nbsp;/////////imagen</span>
            </div>
        </div>
    );
};

export default Header;
